import './App.css'
import Cards from './components/Cards.jsx'
import { userState } from 'react';
import Nav from './components/Nav.jsx';
function App () {
  const [characters] = userState()
  return (
    <div className='App' style={{ padding: '25px' }}>
      <hr />
      <div><Nav></Nav></div>
      <div>
        <Cards
          characters={characters}
        />
      </div>
      <hr />
     
    </div>
  )
}

export default App
